import React, { useState } from "react";
import CustomButton from "../../../components/button";
import {
  AppBar,
  Container,
  Menu,
  MenuItem,
  Toolbar,
  Typography,
} from "@mui/material";
import "./index.scss";
import userIcon from "../../assets/icon/user.svg";
import shoppingBag from "../../assets/icon/shopping-bag.svg";
import heart from "../../assets/icon/heart.svg";
import carretDown from "../../assets/icon/carret - down.svg";
import carretDownWhite from "../../assets/icon/carret-down-white.svg";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";
import { logoutUser } from "../../redux/features/auth/loginSlice";
import Select from "react-select"; // Import react-select

const options = [
  { value: "option1", label: "Option 1" },
  { value: "option2", label: "Option 2" },
  { value: "option3", label: "Option 3" },
  // Add more options as needed
];

function AppbarCustom() {
  const navigator = useNavigate();
  const dispatch = useDispatch();
  const [anchorEl, setAnchorEl] = useState(null);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Dispatch action untuk melakukan logout di Redux state
    dispatch(logoutUser());

    // Hapus data login dari local storage (jika Anda menyimpan token di local storage)
    localStorage.removeItem("token");

    // Redirect ke halaman login
    navigator("/login");
  };

  return (
    <div>
      {" "}
      <AppBar
        position="static"
        elevation={0}
        style={{ backgroundColor: "#FFF", color: "#000" }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}></Typography>
          <div className="content-wrapper">
            <div className="search-input">
              {/* Ganti TextField dengan react-select */}
              <Select
                options={options}
                placeholder="Search"
                isClearable
                isSearchable
                styles={{
                  control: (provided) => ({
                    ...provided,
                    width: "400px",
                    height: "40px",
                    borderTopLeftRadius: "7px",
                    borderBottomLeftRadius: "7px",
                    boxShadow: "0px 1px 4px 0px rgba(0, 0, 0, 0.25)",
                  }),
                  input: (provided) => ({
                    ...provided,
                    fontFamily: "Montserrat",
                  }),
                  valueContainer: (provided) => ({
                    ...provided,
                    fontFamily: "Montserrat",
                  }),
                  placeholder: (provided) => ({
                    ...provided,
                    color: "#868686",
                    fontFamily: "Montserrat",
                    fontSize: "16px",
                  }),
                  indicatorSeparator: () => ({
                    display: "none",
                  }),
                  dropdownIndicator: (provided) => ({
                    ...provided,
                    padding: "8px 15px",
                    backgroundColor: "$color-red",
                    color: "#fff",
                    borderTopRightRadius: "7px",
                    borderBottomRightRadius: "7px",
                    cursor: "pointer",
                    boxShadow: "0px 1px 4px 0px rgba(0, 0, 0, 0.25)",
                  }),
                }}
              />
            </div>
            <div>
              <img src={heart} alt="heart" />
            </div>
            <div>
              <img src={shoppingBag} alt="shopping bag" />
            </div>
            <div onClick={handleMenuOpen}>
              <img src={userIcon} alt="user" />
              <img src={carretDown} alt="carret" />
            </div>
          </div>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            anchorOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
            transformOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
          >
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
      <div className="header">
        <Container style={{ maxWidth: "1300px" }}>
          <div className="content">
            <span>BELANJA</span>
            <img src={carretDownWhite} alt="carret" />
          </div>
        </Container>
      </div>
    </div>
  );
}

export default AppbarCustom;
